B.aG3=new A.t("Material Design 3",null,null,null,null,null,null,null,null,null,null)
B.aCN=new A.t("The in Flutter 2.10.0 introduced Material 3 ColorScheme is used and fully supported. However, components in Flutter 2.10.x do not yet use any of the updated ColorScheme's new colors by default. When you enable FlexColorScheme's component sub-themes you get a theme that is close to the Material 3 style by default. With the component sub-themes settings you can adjust it further, and e.g. change which ColorScheme color each component uses. This is a convenient way to select and use any ColorScheme based color, as the themed color for components included in FlexColorScheme's supported component theme customization capabilities.\n\nVery few Material 3 widgets and styles are available in Flutter 2.10.x and earlier. The updated ColorScheme, NavigationBar and a flag to use a selection indicator on NavigationRail are the only current M3 features.\n\nThere is a toggle in ThemeData that you can turn on to enable available built-in M3 styles in Flutter. It still has almost no effect on UI widget defaults in Flutter. The indicator on the NavigationRail is the only thing it affects so far. It will be used more in future Flutter versions. When it is, we can use the toggle here to see what it does.",null,null,null,null,null,null,null,null,null,null)
B.amS=new A.cE(null,B.aG3,B.aCN,null,!1,null,null,null,null,!0,null,!1,null,null,!1,null,null,null,null)
B.aGf=new A.t("Light theme blend level",null,null,null,null,null,null,null,null,null,null)
B.Fq=new A.t("Adjust the surface, background, scaffold and dialog blend level. Also impacts surfaces when seed colors are used. Seed based surfaces already include a touch of primary, but you can make it stronger with surface blends",null,null,null,null,null,null,null,null,null,null)
B.amT=new A.cE(null,B.aGf,B.Fq,null,!1,null,null,null,null,!0,null,!1,null,null,!1,null,null,null,null)
B.aEo=new A.t("With FlexTones, you can configure which tone from generated palettes each color in the ColorScheme use. Set limits on used CAM16 chroma values for the three colors used as keys for primary, secondary and tertiary TonalPalettes.",null,null,null,null,null,null,null,null,null,null)
B.amU=new A.cE(null,null,B.aEo,null,!1,null,null,null,null,!0,null,!1,null,null,!1,null,null,null,null)
B.aEx=new A.t("Custom colors",null,null,null,null,null,null,null,null,null,null)
B.aGa=new A.t("With component themes enabled you can select scheme color for the tab items and indicator separately. Using TabBarStyle conveniently syncs the TabBar to active AppBar or surface theme, but this offers more options if that is needed. These settings override used TabBarStyle, set them back to default to use TabBarStyle again.",null,null,null,null,null,null,null,null,null,null)
B.amV=new A.cE(null,B.aEx,B.aGa,null,!1,null,null,null,null,!0,null,!1,null,null,!1,null,null,null,null)
B.aDv=new A.t("In Material Design 3, seed generated light and dark mode ColorSchemes use same key colors to generate six tonal palettes. Both light and dark theme ColorScheme colors are picked from these palettes, but using different tones. To ensure light and dark themes use identical tonal palettes, FlexColorScheme automatically only uses the light mode colors from built-in schemes to seed ColorSchemes. When using custom colors, you can decide if you do so or not.",null,null,null,null,null,null,null,null,null,null)
B.amW=new A.cE(null,null,B.aDv,null,!1,null,null,null,null,!0,null,!1,null,null,!1,null,null,null,null)
B.aFA=new A.t("Colors are controlled in each component's settings panel. Above default or currently selected ColorScheme based used theme color for each component.",null,null,null,null,null,null,null,null,null,null)
B.amX=new A.cE(null,null,B.aFA,null,!1,!0,null,null,null,!0,null,!1,null,null,!1,null,null,null,null)
B.aG9=new A.t("Dark theme blend level",null,null,null,null,null,null,null,null,null,null)
B.amY=new A.cE(null,B.aG9,B.Fq,null,!1,null,null,null,null,!0,null,!1,null,null,!1,null,null,null,null)
B.aF9=new A.t("Blended surfaces and backgrounds",null,null,null,null,null,null,null,null,null,null)
B.aDb=new A.t("Material Design 2 guide briefly mentions using surfaces with primary color alpha blends. FlexColorScheme surface blends implements it.\n\nMaterial Design 3 has a new color system where a hint of primary color is also used on surfaces. It is done via its neutral tonal palettes that are shifted slightly towards the primary color. If you use M3 seeded ColorSchemes and set blend level to zero, you get the M3 design. With surface blends, you can further strengthen the effect and vary blend levels by surface type.",null,null,null,null,null,null,null,null,null,null)
B.amZ=new A.cE(null,B.aF9,B.aDb,null,!0,null,null,null,null,!0,null,!1,null,null,!1,null,null,null,null)
B.aCO=new A.t("Custom color",null,null,null,null,null,null,null,null,null,null)
B.aD2=new A.t("With component themes enabled you can select scheme color for the themed AppBar background color. Using AppBarStyle is convenient and does not require activating FlexColorScheme component themes, but this offers more choices. Selecting a color to override used AppBarStyle, set it back to default to use AppBarStyle again.",null,null,null,null,null,null,null,null,null,null)
B.an_=new A.cE(null,B.aCO,B.aD2,null,!1,null,null,null,null,!0,null,!1,null,null,!1,null,null,null,null)
B.aCP=new A.t("Input color modifiers",null,null,null,null,null,null,null,null,null,null)
B.aEV=new A.t("Use input modifiers to change the effective colors that define the ColorScheme. The input color values show the color before input modifiers, surrounding color is the effective result. Seeded ColorSchemes also modify input colors, above you can see how.",null,null,null,null,null,null,null,null,null,null)
B.an0=new A.cE(null,B.aCP,B.aEV,null,!1,null,null,null,null,!0,null,!1,null,null,!1,null,null,null,null)
B.aDt=new A.t("Component Themes",null,null,null,null,null,null,null,null,null,null)
B.aD3=new A.t("The opinionated component widget sub theming is ON by default in this app, but OFF by default in the API.  When OFF, FlexColorScheme mostly only harmonize the colors and you can adjust a few common sub-theme properties, like AppBar, see docs to find out more.\n\nThe default sub-theming follows Material Design 3 guideline when possible. It is however still limited by Flutter Material 2 based theming designs. Most visible change is the corner radius on Widgets that depends on Widget type, but also font sizes in the TextTheme.",null,null,null,null,null,null,null,null,null,null)
B.an1=new A.cE(null,B.aDt,B.aD3,null,!1,null,null,null,null,!0,null,!1,null,null,!1,null,null,null,null)
B.aFU=new A.t("You can change button theme colors, default is primary color. All component themes with border radius can also have their own radius changed individually. It then either overrides the M3 default or the set global radius default, depending on what is in use.",null,null,null,null,null,null,null,null,null,null)
B.an2=new A.cE(null,null,B.aFU,null,!1,null,null,null,null,!0,null,!1,null,null,!1,null,null,null,null)
B.aFs=new A.t("Platform",null,null,null,null,null,null,null,null,null,null)
