B.aEg=new A.t("Flutter SDK default background is colorScheme.background for Dialog and DatePickerDialog, but colorScheme.surface for TimePickerDialog. FlexColorScheme sub-themes use surface as default for all dialogs to ensure that they have the same background by default and that elevation overlay color works in dark mode when it is another color than background.\n\nYou can theme them to a shared color scheme based color too, with M3 colors, surface variant is an interesting option.",null,null,null,null,null,null,null,null,null,null)
