B.aCM=new A.t("ThemeData colors are still important in Flutter 2.10 and earlier. Many widgets still depend on them for their default colors. FlexColorScheme keeps them in sync with ColorScheme, to produce an app with consistent colors on all widgets. It will do so as long as the colors exist in ThemeData. If you switch to dark mode and toggle FlexColorScheme ON/OFF, you can see that many colors in ThemeData loose their relation to active ColorScheme.",null,null,null,null,null,null,null,null,null,null)
