B.aEm=new A.t("You can turn FlexColorScheme's theming OFF to see what a theme looks like when using standard Flutter ThemeData.from(colorScheme), using the same active ColorScheme as shown when FlexColorScheme is active. You do not get any component theming then, but you can adjust colors. However, the Scaffold background color will always be equal to background color, since it does not have its own value in ColorScheme.",null,null,null,null,null,null,null,null,null,null)
