B.aEA=new A.t("There are four different ListTile types in Flutter. They are very useful widgets for settings and options. In FlexColorScheme you can for now only quick theme them, by theming the colors of the switches, checkboxes and radio buttons they use.",null,null,null,null,null,null,null,null,null,null)
